INSERT INTO `tbl_house_detail` VALUES (50, '该房源为朝南的主卧室，采光良好，户型方正，居住舒适。此房距三墩地铁站200米（出自百度地图），小区绿城物业管理安全舒适。', '4居室-01卧', ' 小区距三墩站步行约328米 ', '漏水保固，补偿日租金 退租费用，三个工作日到账 环保装修，密闭检测出租 签约三天不满意，无理由换租', 0, '西湖区首开国风美域', 9, '2号线', 131, '三墩站', 45);
INSERT INTO `tbl_house_detail` VALUES (51, '位置概况 本房源为水印康庭小区的一套四居室中的05卧。小区共21栋楼，所在楼栋靠近小区的南门，不管是开车还是走路去小区出入都方便。地铁站就在小区南门左手边，旁边有便利店、理发店、药店、物美超市。平时快递可以丰巢，非常便利。 楼栋概况 2006年小区,每栋楼都独立电梯。现小区实行垃圾分类，有居委会成员协助垃圾分类工作 户型介绍 房源位于3楼，不想等电梯自己上下楼也不费劲。房间是四居室中的05卧，进门左手边就是我们的房间，右边是客厅及厨房，卫生间在走道的右边。房源卧室面积有14平,有采光通透的落地窗，配有1.5*2米的双人床，桌椅，三开门衣柜。', '4居室-05卧', '小区距西文街站步行约169米', '旁边有便利店、理发店、药店、物美超市。平时快递可以丰巢，非常便利', 0, '杭州市下城区水印康亭', NULL, NULL, NULL, NULL, 47);
