INSERT INTO `tbl_house_detail` VALUES (56, '小区周边有超市有医院有早餐店，有菜市场，房间超大，管家也很好喔，因工作调动，可能不在杭州了，中意的话随时联系', '4室1卫 ', ' 小区距临平站步行约835米 ', '主流网咖 一名真鲜奶吧', 0, '余杭区万达广场大华海派风景', NULL, NULL, NULL, NULL, 52);
INSERT INTO `tbl_house_detail` VALUES (59, '1.房屋朝向好南北朝向，采光好，拎包入住，无后顾之忧，干净整洁，非常舒适\n2.小区地段好，交通便利交通方便，楼下公交车站，环境优美，配套设施齐全，是成熟社区周边设施完善有餐饮，超市，医院，学校，银行，健身娱乐设施，能够充分满足您一站式购物3.房屋租金比较便宜，诚心出租，是您正确的选择\n4.让您省时，省心，节约您大把的时间', '3室1厅2卫 15平', '出行方便建国北路旁边', '红会医院', 0, '下城区建国北路地铁站体育场路153号小区', 9, '2号线', 119, '建国北路站', 55);
INSERT INTO `tbl_house_detail` VALUES (60, '无fuck说', '3室1厅2卫 18平', 'hello world', 'hello world', 1, '萧山区建设三路大成名座', 9, '2号线', 119, '建国北路站', 56);
INSERT INTO `tbl_house_detail` VALUES (61, '精装修出租，屋内有空调、大衣柜、桌子、床垫。厨房冰箱共享。卫生间有淋浴，干净整洁；\\n\n周边配套齐全，出行十分便利；\\n\n室内配置：配备品牌家具家电、配套床垫、抱枕、台灯、桌椅、衣柜、空调、洗衣机、冰箱和宽带。\\n\n定期保洁阿姨上门清理卫生，拒绝脏乱差。\\n', '2室1厅1卫', '距离地铁2号线朝阳站1324米', '九龙医院', 0, '萧山御湖公馆', 9, '2号线', 104, '朝阳站', 57);
INSERT INTO `tbl_house_detail` VALUES (62, '租房这件小事从刚毕业就要遇到，对于刚毕业的小白来说，\n需要考虑的点有很多，对于室友的话也要考虑到，是一直以为的痛点！\n\n和黑心水电费说“拜拜”\n想室友都是同龄人，有交流空间吗？\n①每月俩次例行保洁，保证了公共区域的卫生！\n②专业的维修团队，上门免费维修\n③电信光纤，网络生活无障碍！\n④民用峰谷电低至龒毛鸺元一度！\n⑤没有“中介fei”没有“中介fei”没有“中介fei”\n\n有专门的管家给您贴心带看\n床、衣柜、床头柜、书桌、座椅、台灯、床头灯……\n更多空间自己搭配，成为你一个温馨的家\n公共区域有：\n厨房、灭火器、洗衣机、冰箱、燃气热水器\n燃气灶、油烟机、餐桌椅……\n更多房源等你来\n看房电话请联系我', '3室1厅2卫', '黄山中路  ', '沿河', 0, '  闻堰黄山村', 9, '2号线', 113, '飞虹路站', 58);
INSERT INTO `tbl_house_detail` VALUES (63, '房子在广孚中心小区,环境优美,绿化充足\n位于萧山区, 钱江世纪公园,入住即与精英为邻;\n房间配套有离地铁近,,独立阳台,,独立厨卫,,可养宠物,,绿化率高,,集体供暖,,中央供暖,,独立供暖,\n在地铁2号线上,近地铁站钱江世纪城站,200米\n交通便利,附近的,小区周边配套设施齐全', NULL, NULL, NULL, 1, '萧山区钱江世纪公园广孚中心', 9, '2号线', 115, '钱江世纪城站', 59);
INSERT INTO `tbl_house_detail` VALUES (64, '房子在利一家园小区,环境优美,绿化充足\n位于萧山区, 利一家园,入住即与精英为邻;\n房间配套有离地铁近,,独立阳台,,独立厨卫,,可养宠物,,视频看房,\n在地铁2号线上,近地铁站飞虹路站,200米\n交通便利,附近的,小区周边配套设施齐全', NULL, NULL, NULL, 1, '萧山区利一家园利一家园', 9, '2号线', 113, '飞虹路站', 60);
