DROP TABLE IF EXISTS `tbl_house`;
CREATE TABLE `tbl_house`  (
  `id` int(11) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'house唯一标识',
  `title` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '标题',
  `price` int(11) UNSIGNED NOT NULL COMMENT '价格',
  `area` int(11) UNSIGNED NOT NULL COMMENT '面积',
  `room` int(11) UNSIGNED NOT NULL COMMENT '房间数量',
  `floor` int(11) UNSIGNED NOT NULL COMMENT '楼层',
  `total_floor` int(11) UNSIGNED NOT NULL COMMENT '总楼层',
  `watch_times` int(10) UNSIGNED ZEROFILL NULL DEFAULT 0000000000 COMMENT '被看次数',
  `build_year` int(4) UNSIGNED NOT NULL COMMENT '建立年限',
  `status` int(4) UNSIGNED NOT NULL DEFAULT 0 COMMENT '房屋状态 0-未审核 1-审核通过  2-已售  3-逻辑删除',
  `create_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `last_update_time` datetime(0) NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP(0) COMMENT '最近更新时间',
  `city_en_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市拼音缩写: 北京->bj',
  `region_en_name` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '地区拼音缩写: 昌平区-> cpq',
  `cover` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '封面',
  `direction` int(11) NOT NULL COMMENT '房屋朝向 1：东  2: 南 3: 西 4: 北',
  `distance_to_subway` int(11) NOT NULL DEFAULT -1 COMMENT '距地铁距离， 默认： -1：附近无地铁',
  `parlour` int(11) UNSIGNED NOT NULL DEFAULT 0 COMMENT '客厅数量',
  `district` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '小区',
  `admin_id` int(11) NOT NULL COMMENT '所属管理员id',
  `bathroom` int(32) NOT NULL DEFAULT 0 COMMENT '卫生间数量',
  `street` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '街道',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 61 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '房屋信息表' ROW_FORMAT = Dynamic;

